import './App.css';

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import Navbar from './components/Navbar';  // You might have a Navbar component

function App() {
  return (
    <Router>
      <div>
        {/* Include your Navbar or any other global components */}
        <Navbar />

        {/* Define routes using the Switch component */}
        <Routes>
          {/* Home/Index Route */}
          <Route exact path="/">
            <Home />
          </Route>

          {/* Add more routes for other pages/components */}
          {/* <Route path="/about" component={About} /> */}
          {/* <Route path="/contact" component={Contact} /> */}

          {/* Handle 404 - Page Not Found */}
          <Route>
            <div>
              <h1>404 - Not Found</h1>
              {/* You can add a link to navigate back to the home page or another page */}
            </div>
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
